    useEffect(() => {
        const username = props.username;
        
        axios.get('http://localhost:4000/savedpost/' , {username: username})
         .then((response) => {
             console.log(response);
         });
    
      }, []);
    return(
        <div>
          
          {posts.map(post => (
            //  {/*Post */}
            <Thread {...post}/>
            
          ))}
        
           
        </div>
    );
}

